ente.\n\nFiz uma verificação bem minuciosa e caso ocorra algo anormal creio que pode ser alguma entidade do mal querendo me complicar ou bugs do servidor. Mais caso ocorra por favor me acione imediatamente e tente detalhar o máximo possível de como o erro surgiu passo a passo.\n\nTestei por ultimo na rede e  objeto funcionou normalmente em todos os niveis.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\matematica\\ARmat7_un14jg_domino\\provas\\01','2014-05-28 11:13:39',3885,22,1,0),(4025,33,NULL,18,6,'2014-05-28 00:00:00','PRODUÇÃO',NULL,'2014-05-28 11:20:57',3747,22,1,0),(4026,194,NULL,17,6,'2014-05-28 00:00:00','! CHECAGEM ',NULL,'2014-05-28 11:58:35',3975,24,1,0),(4027,194,NULL,17,7,'2014-05-28 00:00:00','! CHECAGEM ','Objeto liberado.','2014-05-28 11:58:48',3975,24,1,0),(4028,451,NULL,17,6,'2014-05-28 00:00:00','CHECAGEM ',NULL,'2014-05-28 12:19:11',3996,24,1,0),(4029,578,NULL,17,6,'2014-05-28 00:00:00','CORREÇÃO',NULL,'2014-05-28 13:40:57',3998,30,1,0),(4030,249,NULL,17,5,'2014-05-29 00:00:00','checagem','Valdeco, você pode checar, por favor? Veja as obs. do Renato.\n\nRelatório do editor:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\buriti\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un04at_medindo_angulos\\revisao\\v5\n\nObjeto:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\buriti\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un04at_medindo_angulos\\provas\\06\n\nObrigada!\n','2014-05-28 13:47:26',0,21,1,0),(4031,195,NULL,17,5,'2014-05-28 00:00:00','!checagem','Valdeco, mais uma checagem ta?\n\nRelatório do editor:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\buriti\\03_reaproveitados\\matematica\\1_ano\\p_BUmat1_un03at_adicao_subtracao\\revisao\\v3\n\nObjeto:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\buriti\\03_reaproveitados\\matematica\\1_ano\\p_BUmat1_un03at_adicao_subtracao\\provas\\04\n\nObrigada!','2014-05-28 13:49:09',0,21,1,0),(4032,38,NULL,18,5,'2014-05-29 00:00:00','PRODUÇÃO','gerar prova nova, com base no consolidado que está na pasta abaixo.\n\nG:\\Depto\\