roduzir o erro da solicitação 1.\n\nNão foi possível fazer a solicitação 9. Alem da programação envolvida estar muito \"amarrada\" para uma adaptação dessas, no tablet de 7\' seria muito ruim para encaixar as argolas.\n\nO tutorial já foi aplicado nesta prova','2014-06-11 09:00:08'),(10908,9,6,5189,NULL,'2014-06-11 09:02:26'),(10909,21,6,5048,NULL,'2014-06-11 09:15:07'),(10910,9,7,5189,'Ajustado.\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\4_ano\\p_BUmat4_un01at_numeracao\\provas\\07\n\nOBS: Como explicado anteriormente, o Chrome começa executando o vídeo em 340x280 pixels e depois redimensiona para 800x600. E quando o objeto está no tablet, ele acaba \"estourando\" e \"escapa\" essa linha preta no canto direito. Não temos o controle desse fluxo do Chrome, portanto não foi possível ajustar a solicitação 3.','2014-06-11 09:30:52'),(10911,9,6,5208,NULL,'2014-06-11 09:31:14'),(10912,8,7,5063,'Relatório na pasta:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un05jg_domino_fracoes\\provas\\04','2014-06-11 09:33:12'),(10913,22,7,5227,'Todos os ajustes foram feitos exceto as solicitações 2 e 3.\n\nOBS:\n\nCOMO EXPLICADO ANTERIORMENTE, ESSA SOLICITAÇÃO NÃO É POSSÍVEL PORQUE DA FORMA QUE ESTA A ESTRUTURA DE CODIGO E FORMATOS DA IMAGEM NÃO PERMITE ESSA AÇÃO, IMPLICANDO EM REFAZER TODO O OBJETO. \n2 – É possível que as moedas que foram destacadas e irão virar nota deem uma piscada (todas juntas) antes de se transformarem na cédula de R$10?\n\nNO HTML NÃO É POSSÍVEL TRABALHAR COM OBJETOS VETORIAIS COMO NO FLASH, NESSE CASO A ÁREA DA GAVETA NÃO ESTA COM O FORMATO DE UM TRAPÉZIO E SIM DE UM QUADRADO. O HTML ENTENDE TUDO INDEPENDENTE DA IMAGEM OU FORMA APLICADA COMO RETÂNGULO. NESSE OBJETO AS MOEDAS E NOTAS ARRASTADAS ESTÃO ALINHADAS DENTRO DESSE RETÂNGULO SE EU AUMENTAR AS MOEDAS E NOTAS FICARAM FORA DA GAVETA. SUGIRO QUE SEMPRE AO ARRASTAR SOLTE O OBJETO NO CENTRO DA GAVETA. \n3 – Favor aumentar um pouco mais a área