\\portugues\\ARpor7_un07an_verbo_ligacao\\provas\\01','2014-05-19 19:02:17'),(14450,21,6,3101,NULL,'2014-05-19 19:08:50'),(14451,21,7,3101,'Pronto, está ok, foi feita a solicitação pedida.','2014-05-19 19:14:20'),(14452,22,7,2633,'Ajustes OK.\n\nNão consegui reproduzir o erro (No Tablet: 1 – Alinhar os números na barra). Testado na Galaxy Tab 2 os alinhamentos estão OK. Verificar a renderização.\n\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un07at_operacoes_decimal\\provas\\04','2014-05-19 19:15:31'),(14453,18,6,2977,NULL,'2014-05-19 19:16:59'),(14454,18,7,2977,'ok','2014-05-19 19:17:02'),(14455,24,7,3089,'Relatório na pasta.','2014-05-19 19:36:20'),(14456,22,7,3003,'Ajustes OK e checado na rede.\n\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\3_ano\\p_BUmat3_un09at_localizacao\\provas\\04','2014-05-19 19:59:11'),(14457,22,6,3079,NULL,'2014-05-19 20:01:15'),(14458,22,7,3079,'Ajustes OK.\n\nOBS: 05. No tablet é possível colocar mais que 4 dígitos na resposta e mesmo assim ele da como certa. Por ex: a resposta seria 2000, mas coloquei 2000000 e deu como correta. Nos meus testes não consegui reproduzir esse erro. Notei que no teclado do tablet realmente vc digita e ele aparece o tanto de numero que vc clicar, mais ao clicar no objeto ele aparece de 1 a 4 caracteres conforme a programação e não passa disso.\n\nUtilizei a galaxy Tab 2 e esta tudo OK.\n\n\nPeço desculpas, mais ao colar ontem no lugar que o Roberto pediu o arquivo não ia, então colei nesse caminho e amanha me da um toque que transfiro para o lugar certo.\n\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\3_ano\\p_BUmat3_un08at_medidas\\provas\\09','2014-05-19 20:30:50'),(14459,9,7,3080,'Ajustado.\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un02at_adicao_multiplicacao\\provas\\06','2014-05-20 07:03:58'),(14460,9,6,3059,NULL,'2014-05-20 07:06:03'),(14461,9,7,3059,'Ajustado.\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\3_ano\\p_BUmat3_un07at_divisao\\provas\\05\n\nOBS: Ajustei o máximo que deu o alinhamento dos botões, mas por alguma razão depois de estraído o vídeo do Flash, \"buga\" o posicionamento deles e ficam ligeiramente diferentes dos da imagem.','2014-05-20 08:07:30'),(14462,22,6,2979,NULL,'2014-05-20 08:32:14'),(14463,9,6,2980,NULL,'2014-05-20 08:37:45'),(14464,9,7,2980,'Prova 04\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\buriti\\03_reaproveitados\\matematica\\1_ano\\p_BUmat1_un06at_dinheiro\\provas\\04\n\nOBS: Já foi informado antes, e mais de uma vez, que não é possível fazer sincronia com áudio no HTML5. A linguagem não possui ferramenta para tal. Portanto as solicitações 2, 3 e 4 não poderão ser feitas.\n\nNa solicitação 5, a forma atual de retirar o ultimo elemento colocado foi feita assim por conta do tablet 7\', porque não tem como aumentar área de clique das notas e moedas na gaveta.','2014-05-20 08:52:17'),(14465,9,6,3091,NULL,'2014-05-20 08:54:57'),(14466,8,6,3086,'G:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\portugues\\ARpor7_un04an_ligacao_II\\provas\\01\n','2014-05-20 08:55:10'),(14467,17,6,3115,NULL,'2014-05-20 08:56:29'),(14468,17,7,3115,'Relatório na pasta:\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un04at_medindo_angulos\\provas\\05','2014-05-20 09:37:50'),(14469,22,7,2979,'Nesse objeto foi solicitado sincronia de locução e objeto. Não é possível fazer por alguns motivos:\n\n* Utilizamos uma linha de comando que não garante o tempo correto de surgimento.\n\n* A linha de comando que seria utilizada para sincronia já esta sendo utilizada em diversas partes do objetos, incluir mais linhas para resolver esse problema ocorreu conflito e mal funcionamento.\n\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\4_ano\\p_BUmat4_un08at_decimal\\provas\\06','2014-05-20 09:39:35'),(14470,9,7,3091,'Ajustado.\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\geografia\\ARgeo7_un05mi_norte_fisico\\provas\\05\n\nOBS:\nSolicitação 2: O que o editor pediu foi o posicionamento dos picos, as cotas estão diferentes para não sobrepor outras da mesma aba.\n\nSolicitação 3: Esse contorno existe no original em Flash e no em HTML5, a arte falou que tudo bem em manter.\n\nSolicitação 5 e 6: Verificado na imagem, não está faltando preenchimento, mas sim possui uma borda para separar as cores. Verificado com a arte e pelo Edu não tem problema ficar assim.\n\nSolicitação 8: Verificado com a arte e a linha do Equador está com a cor padrão.\n\nSolicitação 9: Verificado com a arte e a divisão política deve se sobressair perante as hachuras, por isso o filtro mais escuro.\n','2014-05-20 09:39:54'),(14471,8,7,3086,'G:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\portugues\\ARpor7_un04an_ligacao_II\\provas\\01\n','2014-05-20 09:40:53'),(14472,17,6,3093,NULL,'2014-05-20 09:40:56'),(14473,22,6,2640,NULL,'2014-05-20 09:41:07'),(14474,8,6,3088,NULL,'2014-05-20 09:42:21'),(14475,9,6,3054,NULL,'2014-05-20 09:49:18'),(14476,9,7,3054,'Prova 03\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\geografia\\ARgeo7_un08mi_sul_fisico\\provas\\03','2014-05-20 09:58:37'),(14477,21,6,3125,NULL,'2014-05-20 10:00:06'),(14478,24,6,3152,NULL,'2014-05-20 10:04:02'),(14479,9,6,3126,NULL,'2014-05-20 10:04:30'),(14480,21,7,3125,'Pronto, relatório na pasta.\n\nG:\\Depto\\01_PRODUCAO\\07_Buriti_mercado\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un07at_operacoes_decimal\\provas\\04','2014-05-20 10:06:21'),(14481,21,6,3082,NULL,'2014-05-20 10:10:18'),(14482,9,6,3157,NULL,'2014-05-20 10:30:44'),(14483,21,7,3082,'Pronto, relatório na pasta.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\geografia\\ARgeo7_un04an_populacional\\provas\\02','2014-05-20 10:31:13'),(14484,21,6,3123,NULL,'2014-05-20 10:48:12'),(14485,21,6,3164,NULL,'2014-05-20 10:49:04'),(14486,21,7,3164,'Pronto, está ok, fei