m ambos aparecem a pontuação final e estrelas. Botões avançar e reiniciar nivel  estão funcionando normalmente.\n \nPARABENS FINAL: Estam aparecendo os resultados e estrelas de todos os niveis e calculando. Botões a reiniciar nivel e reiniciar jogo estão funcionando normalmente.\n\nFiz uma verificação bem minuciosa e caso ocorra algo anormal creio que pode ser alguma entidade do mal querendo me complicar ou bugs do servidor. Mais caso ocorra por favor me acione imediatamente e tente detalhar o máximo possível de como o erro surgiu passo a passo.\n\nTestei por ultimo na rede e  objeto funcionou normalmente em todos os niveis.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\matematica\\ARmat7_un14jg_domino\\provas\\01','2014-05-28 11:13:39'),(15062,22,6,3747,NULL,'2014-05-28 11:20:57'),(15063,24,6,3975,NULL,'2014-05-28 11:58:35'),(15064,24,7,3975,'Objeto liberado.','2014-05-28 11:58:48'),(15065,24,6,3996,NULL,'2014-05-28 12:19:11'),(15066,30,6,3998,NULL,'2014-05-28 13:40:57'),(15067,30,7,3998,'segue v1:\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\historia\\ARhis7_un04an_peste_negra\\provas\\01','2014-05-28 14:06:42'),(15068,24,7,3996,'Relatório na pasta.','2014-05-28 14:56:20'),(15069,21,7,3953,'Pronto, consolidado.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\matematica\\ARmat6_un13si_planta\\provas\\02','2014-05-28 14:56:22'),(15070,8,7,3947,'Consolidação feita:\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\matematica\\ARmat6_un08si_xeque\\provas\\04','2014-05-28 14:56:50'),(15071,21,6,4031,NULL,'2014-05-28 14:59:37'),(15072,22,7,3747,'Ajustes ok e checado na rede.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\geografia\\ARgeo6_un01mi_conservacao\\provas\\04\n\nOBS:\n\nA solicitação não foi aplicada. Segundo o editor seria melhor para que não confundisse o usuário, mas conversando com a equipe foi definido que permanecesse da forma que está e que tal duvida de funcionalidades devera ser esclarecidas no manual que acompanha o objeto.