ar um pouco mais a área de aceitação das moedas, pois essa que está no exemplo abaixo não foi aceita e devolvida:\n\nQUALQUER DUVIDA SÓ ME PROCURAR QUE EXPLICO PESSOALMENTE.\n\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\1_ano\\p_BUmat1_un06at_dinheiro\\provas\\06','2014-06-11 09:34:30'),(15882,9,7,5208,'Ajustado.\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\portugues\\navegar\\p_NVpor2_un08in_frase\\provas\\02','2014-06-11 09:35:38'),(15883,21,7,5048,'Pronto, relatório na rede.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\geografia\\ARgeo8_un06in_cuba\\provas\\01','2014-06-11 10:41:57'),(15884,21,6,5210,NULL,'2014-06-11 10:42:38'),(15885,21,7,5210,'Pronto, está ok, foram feitas as solicitações pedidas.','2014-06-11 10:51:21'),(15886,21,6,5215,NULL,'2014-06-11 10:51:36'),(15887,21,7,5215,'Pronto, está ok, foram feitas as solicitações pedidas.','2014-06-11 11:00:51'),(15888,21,6,5261,NULL,'2014-06-11 11:02:37'),(15889,8,7,5086,'Ajustes nas duas versões feitos:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un08an_arte_indigena\\provas\\02','2014-06-11 11:02:38'),(15890,8,7,4977,'Correções feitas. V2 na rede:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\arte\\p_PRart_un07an_povos_indigenas\\provas\\02','2014-06-11 11:04:42'),(15891,21,7,5261,'Pronto, relatório na rede.\n\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\2_ano\\p_BUmat2_un08at_multiplicacao\\provas\\03','2014-06-11 11:56:39'),(15892,21,6,5268,NULL,'2014-06-11 11:57:13'),(15893,22,6,5270,NULL,'2014-06-11 12:01:22'),(15894,22,7,5270,'Descaracterização OK.\n\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\1_ano\\p_BUmat1_un08at_divisao\\provas\\descaracterizada\\01','2014-06-11 12:11:34'),(15895,22,6,5062,NULL,'2014-06-11 12:12:09'),(15896,21,7,5268,'Pronto, está ok, foram feitas as solicitações pedidas.','2014-06-11 12:29:53'),(15897,21,6,5269,NULL,'2014-06-11 12:30:26'),(1589